pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/IERC721.sol";

contract Whale {
    struct Whale {
        uint balance;
        address addr;
    }
    function checkBalance() public view returns (uint256) {
        uint8 maxSupply = 202;

        Whale memory whale;

        uint maxBalance = 0;
        for(uint8 i = 0 ; i < 202; i++) {
            address owner = IERC721(0x484Ec30Feff505b545Ed7b905bc25a6a40589181).ownerOf(i+1);
            uint balance = IERC721(0x484Ec30Feff505b545Ed7b905bc25a6a40589181).balanceOf(owner);

            if (balance > maxBalance) {
                whale.balance = balance;
            }


        }
        return IERC721(0x484Ec30Feff505b545Ed7b905bc25a6a40589181).balanceOf(0x123e710c69b6806ef32Cf52e49dCC5EEEc368a22);
    }
}

